export const TitleAndInput = ({ title }) => {
  return (
  <div className="flex flex-col gap-1">
    <h3 className="text-sm font-bold">{title}</h3>
    <input type="text" name={title} className="w-full md:w-80 h-10 rounded-md focus:outline-none border-2 border-black px-2 bg-transparent text-black"/>
  </div>
  )
}

export const ServiceItem = ({ itemTitle, itemNumber, itemPrice }) => {
  return (
  <div className="flex flex-col">
    <div className="flex flex-col gap-1">
    <h3 className="text-sm font-bold">{title}</h3>
    <input type="text" name={title} className="w-full md:w-80 h-10 rounded-md focus:outline-none border-2 border-black px-2 bg-transparent text-black"/>
  </div>
  </div>
  )
}



export const CreateService = () => {
  return (
    <form method="POST" className="h-screen w-full flex p-10 flex-col pt-20 gap-10">
      <TitleAndInput title={"Service Title"} />
      <TitleAndInput title={"Service number"} />
      <div className="flex gap-2 items-center font-bold">
        <h3>Add item</h3>
        <button type="button" className="bg-black border-2 border-transparent hover:border-white px-2 text-white rounded-md">+</button>
      </div>

      <button type="submit" className="bg-black text-white rounded-md cursor-pointer h-12 px-5 hover:border-white border-2 border-transparent">Create Service</button>
    </form>
  )
}
